script: |
  super -f text -I q12667.spq | sort > q12667.out

inputs:
  - name: q12667.spq
    data: |
      SELECT ALL - + ( col2 ), - col2 * - ( col2 ) * CAST ( NULL AS REAL ) AS col2 FROM tab1 (FORMAT parquet) WHERE NULL NOT BETWEEN + 19 AND + + 54 * - 38;
  - name: tab1

outputs:
  - name: q12667.out
    data: |
